require_once("CCard.php"); 

class CCardSvg { 

    // ------------------------------------------------------------------------------------------- 
    // 
    // Member variables 
    // 
     
     
    // ------------------------------------------------------------------------------------------- 
    // 
    // SvgCard 
    // Return a SVG image of selected card in appropiate scale 
    // 
    function GetCardsAsBox($iCards, $iScale = 1) { 
        $cards = ""; 
        $temp = ""; 
        foreach($iCards as $val) { 
            $cards .= $this->SvgCard($val, $iScale); 
        } 
        if (!empty($cards)) { 
            $temp = "<p><div style='float: left;'>"; 
            $temp .= $cards; 
            $temp .= "</div><div style='height: 0; clear: both;'>&nbsp;</div></p>";     
        } 
    return $temp; 
     
    } 
     

    // ------------------------------------------------------------------------------------------- 
    // 
    // SvgCard 
    // Return a SVG image of selected card in appropiate scale 
    //  

    function SvgCard($CCard = NULL, $iScale = 1) { 
        if ($CCard != NULL) { 
            //$CCard = new CCard; 
            $CCardArr = $CCard->GetCardArr(); 
            $CCardSvg = ""; 
            $CCardSVGBack = 0; 
             

            //print_r($CCardArr); 

            if ($CCardArr[2] == 0) { //back 
                 
                //Scale SVG and make a picture 
                $this->SVG_Card["B"]["BLUE"][2] = round($this->SVG_orig_size["Width"] * $iScale); 
                $this->SVG_Card["B"]["BLUE"][4] = round($this->SVG_orig_size["Height"] * $iScale); 
                $this->SVG_Card["B"]["BLUE"][7] = $iScale; 

                 
                $CCardSvg = implode("",$this->SVG_Card["B"]["BLUE"]); 
                //$CCardSVGBack = 1; 
            } else { 
                //Scale header and make a picture 
                $this->SVG_parts[2] = round($this->SVG_orig_size["Width"] * $iScale); 
                $this->SVG_parts[4] = round($this->SVG_orig_size["Height"] * $iScale); 
                $this->SVG_parts[7] = $iScale; 
                 
                 
                //$CCardArr[0] = "H"; 
                 
                if ($this->SVG_Card[$CCardArr[0]][$CCardArr[1]] =="") { 
                 
                                    //Scale SVG and make a picture 
                $this->SVG_Card["B"]["BLUE"][2] = $this->SVG_orig_size["Width"] * $iScale; 
                $this->SVG_Card["B"]["BLUE"][4] = $this->SVG_orig_size["Height"] * $iScale; 
                $this->SVG_Card["B"]["BLUE"][7] = $iScale; 
                    $CCardSvg = implode("",$this->SVG_Card["B"]["BLUE"]); 
                } else { 
                     
                 
                $CCardSvg = implode("", $this->SVG_parts). $this->SVG_Card[$CCardArr[0]][$CCardArr[1]]; 
                } 
            } 
        } 

     
        $Output = $CCardSvg; 

        return $Output; 
    } 

